function onClickUnidebOrganizationItem(e) {
  var openItem = document.getElementById("unideb-organizations").querySelector("li.dropdown-menu-column.show");
  openItem.classList.remove("show");
  e.target.parentElement.classList.add("show");
  e.stopPropagation();
  e.preventDefault();
}

function initUnidebOrganizations() {
  document.getElementById("unideb-organizations").addEventListener("click", notHidingClickInside);
  var items = document.getElementById("unideb-organizations").querySelectorAll("li.dropdown-menu-column > a");
  for (var i = 0; i < items.length; i += 1) {
    items[i].addEventListener("click", onClickUnidebOrganizationItem);
  }
}

function notHidingClickInside(e) {
  e.stopPropagation();
}

if (document.getElementById("unideb-organizations")) {
  initUnidebOrganizations();
}
